import axios from 'axios'

export default () => {
  const URL = 'https://cors-anywhere.herokuapp.com/https://www.arnoldclark.com/used-cars/search.json?payment_type=monthly&min_price=100&max_price=150&sort_order=monthly_payment_up';
  return axios.get(URL)
    .then(response => response.data)
    .catch(error => {
      throw error;
    });
};
